var util          = require("util");
var RequestHeader = require("../request");

function ProxyAuthorizationHeader(value) {
    RequestHeader.call(this, value);
}

util.inherits(ProxyAuthorizationHeader, RequestHeader);

ProxyAuthorizationHeader.prototype.getKey = function() {
    return "Proxy-Authorization";
};

module.exports = ProxyAuthorizationHeader;
